import React, { useRef, useState } from 'react';
import BurgerIcon from './Burger';
import classnames from 'classnames';
import { useNavigate } from 'react-router-dom';
import { useOnClickOutside } from '../hooks/useOnClickOutside';

const FrameComponent1 = () => {
  const [isMenuVisible, setIsMenuVisible] = useState(false);
  const ref = useRef();
  const navigate = useNavigate();

  const toggleMenu = () => {
    setIsMenuVisible((prev) => !prev);
    document.body.style.overflow = isMenuVisible ? 'auto' : 'hidden';
  };

  const handleNavigation = (hash) => {
    navigate(`/#${hash}`);
    setIsMenuVisible(false);
    document.body.style.overflow = 'auto';
  };

  return (
    <section className="self-stretch flex flex-col items-start justify-start gap-[152px] max-w-[1280px] text-left text-lg text-mediumblue font-satoshi mq768:gap-[16px] mq450:gap-[0x]">
      <div
        ref={ref}
        className={classnames(
          'fixed top-0 bottom-0 z-10 right-0 items-start justify-center bg-white transition-all mq768:flex hidden shadow-2xl shadow-slate-700',
          {
            'left-[200%]': !isMenuVisible,
            'left-1/2 mq450:left-1/3': isMenuVisible,
          }
        )}
      >
        <div className="flex flex-col items-center justify-center gap-4 pt-28">
          <div
            onClick={() => handleNavigation('o-nas')}
            className="relative visited:text-[unset] no-underline font-medium inline-block min-w-[47px] whitespace-nowrap cursor-pointer"
          >
            O nas
          </div>
          <div
            onClick={() => handleNavigation('fands')}
            className="relative visited:text-[unset] font-medium no-underline inline-block min-w-[127px] whitespace-nowrap cursor-pointer"
          >
            Funkcje i Usługi
          </div>
          <button className="cursor-pointer [border:none] py-[13px] px-6 bg-mediumblue rounded-29xl flex flex-row items-center justify-center whitespace-nowrap hover:bg-mediumslateblue">
            <div onClick={() => navigate('https://form.typeform.com/to/pf33IhfC')} className="relative text-base tracking-[-0.01em] font-medium font-satoshi text-white text-left">
            <a href="https://form.typeform.com/to/pf33IhfC" class="block text-base tracking-[-0.01em] font-medium font-satoshi text-white text-left no-underline hover:no-underline focus:no-underline">
            Zapisz się już teraz!
           </a>
            </div>
          </button>
        </div>
      </div>

      <header className="flex flex-row items-center self-stretch justify-between w-full text-lg text-left text-mediumblue font-satoshi">
        <div className="w-[253px] flex flex-row items-center justify-start">
          <img
            className="h-7 w-[170.4px] z-0 relative overflow-hidden shrink-0 cursor-pointer"
            loading="lazy"
            alt=""
            src="/teraz-cash--logo.svg"
            onClick={() => navigate('/')}
          />
        </div>
        <div className="w-[453px] flex flex-row items-center justify-start gap-[48px] max-w-full mq768:hidden mq450:gap-[24px]">
          <div
            onClick={() => handleNavigation('o-nas')}
            className="relative visited:text-[unset] no-underline font-medium inline-block min-w-[47px] whitespace-nowrap cursor-pointer"
          >
            O nas
          </div>
          <div
            onClick={() => handleNavigation('fands')}
            className="relative visited:text-[unset] no-underline font-medium inline-block min-w-[127px] whitespace-nowrap cursor-pointer"
          >
            Funkcje i Usługi
          </div>
          <button className="cursor-pointer [border:none] py-[13px] px-6 bg-mediumblue rounded-29xl flex flex-row items-center justify-center whitespace-nowrap hover:bg-mediumslateblue">
            <div className="relative text-base tracking-[-0.01em] font-medium font-satoshi text-white text-left">
            <a href="https://form.typeform.com/to/pf33IhfC" class="block text-base tracking-[-0.01em] font-medium font-satoshi text-white text-left no-underline hover:no-underline focus:no-underline">
            Zapisz się już teraz!
           </a>
            </div>
          </button>
        </div>
        <div className="hidden mq768:block">
          <BurgerIcon toggleMenu={toggleMenu} isMenuVisible={isMenuVisible} />
        </div>
      </header>
    </section>
  );
}

export default FrameComponent1;
